import React from "react"
import CountUp from "react-countup"
const Navbar = (props) =>{
    //const response = props.response.data;
    //const data =  props.res.result;
    
    let count_AC=0;
    for(let i=0;i<props.res.length;i++){
      if(props.res[i].verdict==="OK"){
        count_AC+=1;
      }
    }
    
    
    return(
        <div>
            <h1>AC: <CountUp
                    start = {0}
                    end={count_AC}
                    duration = {1.3}
                    separator = ','

                    /></h1>

            
        </div>
    )



}

export default Navbar
